import React from 'react';
import Login from './Login';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Form from './Form';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/' ><Form /></Route>
        <Route path='/Login' element={<Login />} />
      </Switch>
    </Router>
  );
}

export default App;
